import React from 'react';
import breakfastImage from './images/breakfast.jpg'; // Breakfast Image

const styles = {
  page: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#f9f7f4',
    width: '100%',
    minHeight: '100vh',
  },
  navbar: {
    width: '100%',
    padding: '15px 20px',
    backgroundColor: '#D4AF37',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    color: '#fff',
    fontSize: '18px',
    fontFamily: 'Georgia',
  },
  footer: {
    marginTop: 'auto',
    width: '100%',
    padding: '10px',
    backgroundColor: '#D4AF37',
    color: '#fff',
    textAlign: 'center',
    fontFamily: 'Georgia',
  },
  heroSection: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '30vh',
    width: '100%',
    position: 'relative',
    backgroundImage: `url(${breakfastImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    color: '#fff',
    textAlign: 'center',
  },
  heroOverlay: {
    backgroundColor: 'rgba(0, 0, 0, 0.5)', // Semi-transparent overlay
    padding: '20px',
    borderRadius: '10px',
  },
  contentSection: {
    padding: '20px',
    textAlign: 'center',
    fontFamily: 'Georgia',
    color: '#333',
  },
  headline: {
    fontSize: '36px',
    fontWeight: 'bold',
    margin: '20px 0',
    color: '#8B4513',
  },
  description: {
    fontSize: '18px',
    lineHeight: '1.6',
  },
};

function BreakfastPage() {
  return (
    <div style={styles.page}>
      {/* Navbar */}
      <div style={styles.navbar}>
        <div>CulinarEAT</div>
        <div>Menu</div>
      </div>

      {/* Hero Section */}
      <div style={styles.heroSection}>
        <div style={styles.heroOverlay}>
          <h1>Breakfast Recipes</h1>
        </div>
      </div>

      {/* Content Section */}
      <div style={styles.contentSection}>
        <h2 style={styles.headline}>Start Your Day Right!</h2>
        <p style={styles.description}>
          Explore our delightful breakfast recipes, perfect for energizing your mornings.
          From quick meals to indulgent treats, we have something for everyone.
        </p>
      </div>

      {/* Footer */}
      <div style={styles.footer}>
        &copy; {new Date().getFullYear()} CulinarEAT. All rights reserved.
      </div>
    </div>
  );
}

export default BreakfastPage;
